import React from "react";
function OferaProdus() {
  return (
    <>
      <h1>Ofera un produs</h1>
      {/* <form className="oferaProdus"> */}
        <div>
          <label htmlFor="categorie">Categorie </label>
          <select name="categorii">
            <option value="Lactate">Vegetarian</option>
            <option value="Carne">Iubitor de zacusca</option>
            <option value="Fructe">Vegan</option>
            <option value="iubitor de dulciuri">Iubitor de dulciuri</option>
            <option value="carnivor">Carnivor</option>
          </select>
        </div>
      {/* </form> */}
    </>
  );
}
export default OferaProdus;
